pragma solidity ^0.4.2;


contract Grubscan {
    uint public timeStamp;
    uint public historyCount;

    struct HistoryLog {
        uint id;
        string company;
        uint date;
        string process;
        string treatment;
    }

    mapping(uint => HistoryLog) public historyLogs;

    constructor() public {
        timeStamp = now;
        addHistory("AgroFarms", timeStamp, "Fertilizing", "NPK");
        addHistory("AdankoFarms", timeStamp, "Processing", "Soya Milk");
    }

    function addHistory(
        string company,
        uint date,
        string process,
        string treatment) public 
    {

        historyCount++;
        historyLogs[historyCount] = HistoryLog(historyCount, company, date, process, treatment);

    }
}
